import React, {Component} from 'react';
import'./back.css'
class Back extends Component {
    render() {
        return (
            <div className={'backAndfen'}>
                <div><i className={'iconfont icon-zuobian1'}/></div>
                <div><i className={'iconfont icon-fenxiang'}/></div>
            </div>
        );
    }
}

export default Back;
